import Header from './Components/Header'
import './App.css';
import Footer from './Components/Footer';
import Content from './Components/Content';

function App() {
  return (
    <div className="App">
      <Header/>
      <Content props={data[1].joke}/>
      <Footer/>
    </div>
  );
}

const data = [
  {
    joke: <p>A child asked his father, "How were people born?"
    So his father said, "Adam and Eve made babies, then their babies became adults and made babies, and so on."

    The child then went to his mother, asked her the same question and she told him, "We were monkeys then we evolved to become like we are now."

    The child ran back to his father and said, "You lied to me!"
    His father replied, "No, your mom was talking about her side of the family."</p>
  },
  {
    joke: <p>Teacher: "Kids,what does the chicken give you?"
    Student: "Meat!"
    Teacher: "Very good! Now what does the pig give you?"
    Student: "Bacon!"
    Teacher: "Great! And what does the fat cow give you?"
    Student: "Homework!"</p>
  },
  {
    joke: <p>Teacher: "Kids,what does the chicken give you?"
    Student: "Meat!"
    Teacher: "Very good! Now what does the pig give you?"
    Student: "Bacon!"
    Teacher: "Great! And what does the fat cow give you?"
    Student: "Homework!"</p>
  },
  {
    joke: <p>A housewife, an accountant and a lawyer were asked "How much is 2+2?"
    The housewife replies: "Four!".
    The accountant says: "I think it's either 3 or 4.  Let me run those figures through my spreadsheet one more time."
    The lawyer pulls the drapes, dims the lights and asks in a hushed voice, "How much do you want it to be?"</p>
  }
]

export default App;
